annotations.description:
query getSiteStatistics{
        SiteStatistics {
          anime {
            edges {
              node {
                date
                count
                change
              }
            }
            pageInfo {
              total
              currentPage
            }
          }
        }
      }

query getMediaById($id: Int) {
    Media(id:$id, type:ANIME) {
      title {
        romaji
        english
        native
        userPreferred
      }
      type
      description
    }
  }
